-- #1
IF OBJECT_ID('AwardsPlayers', 'U') IS NULL
BEGIN

    CREATE TABLE AwardsPlayers (
        playerID VARCHAR(255) NOT NULL,      
        awardID VARCHAR(50) NOT NULL,       
        yearID INT NOT NULL,                
        lgID CHAR(2) NOT NULL,              
        tie VARCHAR(1) NULL,       
        notes VARCHAR(255) NULL,          
        
        CONSTRAINT AwardsPlayer_PK PRIMARY KEY (playerID, awardID, yearID, lgID)
    );

-- #2
    ALTER TABLE AwardsPlayers 
        ADD CONSTRAINT AwardsPlayer_FK_PlayerID FOREIGN KEY (playerID) REFERENCES People(playerID);

-- #3
    ALTER TABLE AwardsPlayers
        ADD CONSTRAINT AwardID_Check CHECK (awardID IN (
            'Triple Crown', 'TSN Reliever of the Year', 'TSN Major League Player of the Year', 'Branch Rickey Award',
            'Comeback Player of the Year', 'Rookie of the Year', 'Baseball Magazine All-Star', 'World Series MVP',
            'TSN Fireman of the Year', 'TSN Pitcher of the Year', 'Hank Aaron Award', 'Pitching Triple Crown',
            'All-Star Game MVP', 'Gold Glove', 'Babe Ruth Award', 'Hutch Award', 'TSN All-Star', 'ALCS MVP',
            'Outstanding DH Award', 'NLCS MVP', 'TSN Guide MVP', 'Reliever of the Year Award', 'Lou Gehrig Memorial Award',
            'TSN Player of the Year', 'Cy Young Award', 'Roberto Clemente Award', 'Most Valuable Player', 'Rolaids Relief Man Award',
            'Silver Slugger', 'NLCS MVP', 'TSN Guide MVP', 'Platinum Glove'
        ));

END;

